La recomendación es posicionar tu última experiencia laboral en primer lugar, así será más fácil detectar cuál y dónde fue lo último que estuviste realizando. 🙋🏻‍♀️🤓
 
La estructura es la siguiente:
1. Puesto
2. Lugar y tiempo
3. Funciones

▪️El objetivo es redactar y presentar de forma clara, precisa y atractiva las funciones de tu currículum.
▪️Intenta no plasmar información de más, la recomendación es utilizar viñetas.

🏆 En caso de tener un logro profesional, agrégalo. Señálalo con algún otro formato para que sea fácil de detectar.

⚠️ Importante, no confundas las funciones con logros. ⚠️

📈 Las funciones son el conjunto de responsabilidades, tareas, actividades necesarias para desempeñar un determinado puesto de trabajo.
🏆 Por otro lado, los logros son el resultado satisfactorio de la ejecución excelente de una función o grupo de funciones.

Espero sea de utilidad esta información, en caso de querer que revise o diseñe tu CV mandame un DM 🙋🏻‍♀️📥

